        pause(1000)
        Pause = false
        sprite32.setFlag(SpriteFlag.Invisible, false)
        statusbar.setFlag(SpriteFlag.Invisible, false)
        news_PList[news_count].setFlag(SpriteFlag.Invisible, true)
        news_count = news_count + 1
